import { v4 as uuidv4 } from 'uuid';

const projects = [
  {
    id: uuidv4(),
    name: 'U Tracker',
    desc:
      'An application to track your all data from one place. I developed the website and the mobile app',
    img:
      'http://127.0.0.1:8000/media/acde6dac-d3f2-41ce-ba6a-9b4351f59c07.jpeg',
  },
  {
    id: uuidv4(),
    name: 'Green CTG',
    desc:
      'An app to help people to get an overview of how they can make the city beautiful.',
    img:
      'http://127.0.0.1:8000/media/cc92c24e-1de4-4813-9863-397a218c2275.jpeg',
  },
  {
    id: uuidv4(),
    name: 'Coin Tracker',
    desc:
      'Using this app you can track any e coin. Also you will get a good advise about investment form the professional',
    img:
      'http://127.0.0.1:8000/media/b13c2589-e892-4313-9993-d546e3f1030f.jpeg',
  },
  {
    id: uuidv4(),
    name: "Cavin's Portfolio",
    desc:
      'A portfolio for Cavin jr. A artist from New york city. The portfolio is made using ReactJs and GatsbyJs.',
    img:
      'http://127.0.0.1:8000/media/43ff68c7-cd09-4736-9821-82a67a25a354.jpeg',
  },
  {
    id: uuidv4(),
    name: 'Tracking Soft',
    desc:
      'A tracking website that will show the performance of the website. Also you will get some useful advice to improve the performance.',
    img: 'http://127.0.0.1:8000/media/cuisine.jpeg',
  },
  {
    id: uuidv4(),
    name: 'Tracking Soft',
    desc:
      'A tracking website that will show the performance of the website. Also you will get some useful advice to improve the performance.',
    img:
      'http://127.0.0.1:8000/media/1364d9be-bb58-4916-88bf-3c583e8a7384.jpeg',
  },
];

export default projects;
